import {Link} from "react-router-dom";

function Header(){
    return(
        <header className="row">
            <div>
                <Link className="brand" to="index.html">amazona</Link>
            </div>
            <div>
                <Link to="cart.html">Cart</Link>
                <Link to="signin.html">Sign In</Link>
            </div>
        </header>
    )
}
export default Header
